import {BrowserRouter,Routes,Route} from 'react-router-dom'

function Home(){
    return(
        <>
        <BrowserRouter>
<Routes>
    <Route path="src\Components\Items\Items.js" element={<Home />} />
</Routes>
        </BrowserRouter>
        </>
    )
}
export default Home;
